import React, {useState, useEffect} from 'react'
import axios from 'axios'
import './App.css';

const URL = `https://kitsu.io/api/edge/trending/anime`

function App() {
  useEffect(() => {
    axios.get(URL)
    .then()
    .catch()
  })
  return (
    <div>
      <h1>Trending Anime</h1>
    </div>
  )
}

export default App;
